CREATE DEFINER=`root`@`localhost` PROCEDURE `actualizarEmpleado`(in id int(11), in nombres varchar(45),in apellidos varchar(45),in edad int(2),in usuario varchar(45),in contrasena varchar(8), in rool varchar(20))
begin
    update empleados set empleados.Nombres = nombres , empleados.Apellidos =apellidos ,
    empleados.Edad = edad , empleados.Usuario = usuario , empleados.contrasena = contrasena
